INSERT INTO course(course_id, name, identifier, description, audience, alternate_name)
VALUES ('2abc9ef4-c7a9-43b3-8391-04006288e324', 'Blue Course', 'BC0', 'Aranea atrox capio tantum vae delectus suffoco templum vapulus. Eaque dedecor ancilla culpa omnis deduco auctor sublime.', 'Extremism offence', 'BC'),
       ('953d6a6b-6f3d-4631-b7e8-e0e94b52e777', 'Yellow Course', 'YC1', 'Ait thesis consectetur quae terminatio alter quas arcus quidem sophismata. Repellat facere spes tabesco thymbra administratio. Vulgus corona stipes demum cito.', 'Intimate partner violence offence', 'YC'),
       ('17bd04d6-f6ed-4ed2-9e35-bf5c3d63fe5d', 'Olive Course', 'OC2', 'Demens deorsum aduro non stipes vehemens ante accommodo suasoria. Coerceo speculum utilis caelestis sono territo texo theca. Degenero bene timor cruciamentum aequitas vigilo. Acies volup pectus cultura. Balbus coepi cupio conspergo corrupti fugiat.', 'Gang offence', 'OC'),
       ('79a39e0f-ef30-4597-8c14-43d258271125', 'Indigo Course', 'IC3', 'Verumtamen conatus vel arbitro. Usus sortitus tenus summopere substantia auditor. Tot valetudo cattus adversus caries corroboro delectus aperte odio.', 'Extremism offence', 'IC'),
       ('5ea4d1a0-3fa6-4e86-bf35-52b0675c4c10', 'Fuchsia Course', 'FC4', 'Antepono sint dapifer utpote aggredior similique circumvenio spectaculum. Versus sperno stipes arto claudeo adipisci arguo tamen sulum terminatio. Altus clam aer sopor tonsor aggero corrupti spes aduro. Conduco cultura quidem at aetas. Defessus clarus bardus.', 'General violence offence', 'FC'),
       ('f81fad22-dd16-42ec-98d8-7a0c65d2bf9c', 'Maroon Course', 'MC5', 'Cilicium studio socius soleo confido tabella crepusculum tredecim. Trepide varietas aspernatur. Aequitas deputo tantum corrumpo supra.', 'General violence offence', 'MC'),
       ('384fb7a0-58cf-4018-a865-3bbc7f984bd3', 'Ivory Course', 'IC6', 'Deinde solutio eaque cultura amplus canis admiratio. Cresco beneficium ocer nostrum. Angustus adulatio ocer eaque solio curia cattus candidus. Condico arca adopto molestiae cubicularis barba appositus surculus urbanus adhaero. Cavus thesis dolorem centum. Tardus vorago coerceo laboriosam concedo venia culpo cupressus reiciendis.', 'Sexual offence', 'IC'),
       ('c0c6e603-d276-4f2d-9da3-a2dee5e38889', 'Silver Course', 'SC7', 'Curis surculus ustulo aedificium abstergo. Speculum alioqui aranea cupressus comprehendo armarium vesper tantum. Statua ipsa calculus consectetur eos crudelis minima. Aufero sumo custodia minus casus admitto. Ambulo absque vorax admiratio cenaculum nobis vulariter demens. Aspernatur provident quaerat deorsum cibo aegre.', 'General violence offence', 'SC'),
       ('9c85796d-1c24-4c71-a05c-9ef725d4d423', 'Olive Course', 'OC8', 'Subito attollo copia vomer tam aiunt. Vergo cometes vilitas. Traho circumvenio creo. Trepide cupressus maiores error nostrum sortitus volup expedita esse demonstro.', 'Intimate partner violence offence', 'OC'),
       ('1427fb3d-f6da-4f3c-bdcb-6b35a4a27efe', 'Indigo Course', 'IC9', 'Depopulo volubilis corona apostolus alveus arcesso cura utor vir. Verbera creta tabella ab comparo claustrum vos. Venustas vinitor subvenio sub surculus veniam amita. Architecto magnam tergo super conduco. Currus adfero summisse calculus. Tepesco bis viriliter deduco condico verecundia claustrum absum.', 'Gang offence', 'IC');

